svg.script:
(function() {
  var gradient = document.getElementById('shinyBorderGradient');
  var angle = 0;

  function animate() {
    angle = (angle + 1) % 360;
    gradient.setAttribute('gradientTransform', 'rotate(' + angle + ' 0.5 0.5)');
    requestAnimationFrame(animate);
  }

  animate();
})();
